con:config.script:
import groovy.time.TimeCategory 
import com.eviware.soapui.SoapUI

   def log = SoapUI.log
   def index = context.getCurrentStepIndex()+1
   def testStep = testRunner.testCase.getTestStepAt(index)
   def request = testStep.getTestRequest()

   def languageId = testRunner.testCase.getPropertyValue( "languageId" )
   def categoryId = testRunner.testCase.getPropertyValue( "categoryId" )
   def eventTypeId = testRunner.testCase.getPropertyValue( "eventTypeId" )
   def eventId = testRunner.testCase.getPropertyValue( "eventId" )

   testRunner.testCase.setPropertyValue( "categoryId", categoryId )
   testRunner.testCase.setPropertyValue( "languageId", languageId )
   testRunner.testCase.setPropertyValue( "eventTypeId", eventTypeId )


   def builder = new groovy.json.JsonBuilder()
   def map = [:]

   def currentDate = new Date()

 	use( TimeCategory ) {
    		startDate = (currentDate - 440.minutes).getTime()

	}

	use( TimeCategory ) {
    		endDate = (currentDate + 420.minutes).getTime()
	}

   testRunner.testCase.setPropertyValue( "expiresDate", String.valueOf(endDate) )
   testRunner.testCase.setPropertyValue( "startDate", String.valueOf(startDate) )


   map.put('languageId', languageId)
   map.put('eventId', eventId)   
   map.put('startDate', startDate)
   map.put('expireDate', endDate)


   builder(map)
   request.setRequestContent(builder.toString())

